jQuery(document).ready(function(){
  // Banner background image
    var bg_img = jQuery('.banner-wrap .img-wrap img').attr('src');
    jQuery('.banner-wrap').css('background-image', 'url(' + bg_img + ')');

    var bg_img_partner_with = jQuery('.partner-with-wrap-main .img-wrap img').attr('src');
    jQuery('.partner-with-wrap-main').css('background-image', 'url(' + bg_img_partner_with + ')');


  // Toggle menu
  jQuery('body').click(function(){
    jQuery('.sidemenu-main').removeClass('open');
    jQuery('.toggle-menu').removeClass('open');
    jQuery('.profile-option').slideUp();
    jQuery('.notification-wrap ul').slideUp();
    jQuery('.submenu-main ul').slideUp();
  });
  jQuery('.sidemenu-main').click(function(event){
    event.stopPropagation();
  });
  jQuery('.toggle-menu').click(function(event) {
    event.stopPropagation();
    jQuery('.sidemenu-main').toggleClass('open');
    jQuery(this).toggleClass('open');
  });

  // Sidemenu Submenu JS
  jQuery('.submenu-main').click(function(event) {
    event.stopPropagation();
    if(jQuery(this).siblings('.submenu-main').find('ul').css('display') == 'block') {
      jQuery('.submenu-main ul').slideUp();
    }
    jQuery(this).find('ul').slideToggle();
  });
  
  // Profile Dropdown JS 
  jQuery('.profile-option').click(function(event) {
    event.stopPropagation();
  });
  jQuery('.profile-wrap a').click(function(event) {
    event.stopPropagation();
    jQuery('.profile-option').slideToggle();
    jQuery('.notification-wrap ul').slideUp();
  });

  // New theme sidebar Js
  jQuery('.sidebar-control').click(function() {
    jQuery('.new-sidemenu-main').toggleClass('shrink');
    jQuery('body').toggleClass('sidebar-shrink');
  });
  jQuery('.new-sidemenu-main ul > li > a').click(function() {
    if(jQuery('body').hasClass('sidebar-shrink') && jQuery(window).width() > 767) {
      jQuery('.new-sidemenu-main').removeClass('shrink');
      jQuery('body').removeClass('sidebar-shrink');
    } 
  });
  jQuery('.new-sidemenu-main ul > li > a').click(function() {
    if(jQuery(window).width() < 768) {
      jQuery('.new-sidemenu-main').addClass('shrink');
      jQuery('body').addClass('sidebar-shrink');
    } 
  });

  // Profile Dropdown JS
  jQuery('.notification-wrap ul').click(function(event) {
    event.stopPropagation();
  });
  jQuery('.notification-icon').click(function(event) {
    event.stopPropagation();
    jQuery('.notification-wrap ul').slideToggle();
    jQuery('.profile-option').slideUp();
  });

  // Login Tabs JS
  jQuery('.tabs-wrap li a').click(function() {
    var target = "#" + this.getAttribute('data-target');
    jQuery('.tabs-wrap li').removeClass('active');
    jQuery('.tabs-content').removeClass('active');
    jQuery(this).parent('li').addClass('active');
    jQuery('body').find(target).addClass('active');
  });


  // Custom checkbox js
  jQuery('input[type="checkbox"]').wrap('<div class="input-rc"></div>');
  jQuery('.input-rc').append('<span class="input-rc-span"></span>');

  
});

